The Pink Panther Strikes Again
Director: Blake Edwards
Cast: Peter Sellers, Herbert Lom, Lesley-Anne Down, Burt Kwouk, Colin Blakely, Leonard Rossiter ....
Genre: Comedy / Crime
Year of Production: 1976
Country: UK / USA


Plot: Former Chief Inspector Charles Dreyfus is nearly set to be released from a mental hospital after being cleared. However, a visit from current Chief Inspector Jacques Clouseau resurrects his insanity, and he is denied leaving. Determined to take out Clouseau once and for all, he escapes and blows up Clouseau&amp;#039;s apartment, but fails to kill Clouseau. As a back-up plan, he abducts a famous scientist in order to build a Doomsday Machine which vaporizes whatever it shoots. Dreyfus threatens to use it unless Clouseau is exterminated, so reluctantly, 26 countries send their top assassin to kill the Chief Inspector. His clumsiness saves him again, and the assassin&amp;#039;s attempts kill each other. In a conquest to save the world, Clouseau heads out to put an end to Dreyfus&amp;#039;s terror once and for all.
